import axios from "axios";
import React, { useCallback, useEffect, useState } from "react";
import images from "../../assets";
import {
  bayutUrl,
  fetchApi,
  rentOptions,
  saleOptions,
} from "../../utiles/fetchApi";
import BannerSections from "./bannerSections";
import constants from "./constants";
import PropertySection from "./sections";
import { HeaderContainer, PropertySectionInnerContainer } from "./styles";

export default function Home() {
  const [salePropertyArray, setSalePropertyArray] = useState([
    {
      title: "default 1",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      area: "NA",
      image: "NA",
      externalID: "",
    },
    {
      title: "default 2",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      area: "NA",
      image: "NA",
      externalID: "",
    },
    {
      title: "default 3",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      area: "NA",
      image: "NA",
      externalID: "",
    },
  ]);
  const [rentPropertyArray, setRentPropertyArray] = useState([
    {
      title: "default 1",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      area: "NA",
      image: "NA",
      externalID: "",
    },
    {
      title: "default 2",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      area: "NA",
      image: "NA",
      externalID: "",
    },
    {
      title: "default 3",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      area: "NA",
      image: "NA",
      externalID: "",
    },
  ]);

  const getResults = useCallback(async () => {
    const results = await fetchApi(
      `${bayutUrl}/properties/list?locationExternalIDs=5002%2C6020&purpose=for-rent&hitsPerPage=3&page=0&lang=en&sort=city-level-score&rentFrequency=monthly&categoryExternalID=4`
    );
    const rentResults = await fetchApi(
      `${bayutUrl}/properties/list?purpose=for-rent`
    );
    const searchData = results.hits;
    console.log(searchData);
    const rentData = results.hits;
    setSalePropertyArray([
      {
        title: searchData[0].title,
        image: searchData[0].coverPhoto.url,
        baths: searchData[0].baths,
        rooms: searchData[0].rooms,
        price: searchData[0].price,
        area: searchData[0].area,
        externalID: searchData[0].externalID,
      },
      {
        title: searchData[0].title,
        image: searchData[0].coverPhoto.url,
        baths: searchData[0].baths,
        rooms: searchData[0].rooms,
        price: searchData[0].price,
        area: searchData[0].area,
        externalID: searchData[0].externalID,
      },
      {
        title: searchData[0].title,
        image: searchData[0].coverPhoto.url,
        baths: searchData[0].baths,
        rooms: searchData[0].rooms,
        price: searchData[0].price,
        area: searchData[0].area,
        externalID: searchData[0].externalID,
      },
    ]);
    setRentPropertyArray([
      {
        title: searchData.hits[0].title,
        image: searchData.hits[0].coverPhoto.url,
        baths: searchData.hits[0].baths,
        rooms: searchData.hits[0].rooms,
        price: searchData.hits[0].price,
        area: searchData.hits[0].area,
        externalID: searchData.hits[0].externalID,
      },
      {
        title: searchData.hits[0].title,
        image: searchData.hits[0].coverPhoto.url,
        baths: searchData.hits[0].baths,
        rooms: searchData.hits[0].rooms,
        price: searchData.hits[0].price,
        area: searchData.hits[0].area,
        externalID: searchData.hits[0].externalID,
      },
      {
        title: searchData.hits[0].title,
        image: searchData.hits[0].coverPhoto.url,
        baths: searchData.hits[0].baths,
        rooms: searchData.hits[0].rooms,
        price: searchData.hits[0].price,
        area: searchData.hits[0].area,
        externalID: searchData.hits[0].externalID,
      },
    ]);
  }, []);

  useEffect(() => {
    getResults();
  }, [getResults]);

  let urlString = "/search/property/";
  return (
    <>
      <HeaderContainer />
      <BannerSections
        image={images.rentBanner}
        description={constants.rentProperty.description}
        title={constants.rentProperty.title}
        button={constants.rentProperty.button}
        link={constants.rentProperty.link}
      ></BannerSections>
      <PropertySectionInnerContainer>
        {rentPropertyArray.map((array) => {
          if (array.externalID === "") {
            urlString = "";
          }
          return (
            <PropertySection
              title={array.title}
              baths={array.baths}
              rooms={array.rooms}
              price={Number(array.price)}
              area={Number(array.area)}
              image={array.image}
              link={`${urlString}${array.externalID}`}
            ></PropertySection>
          );
        })}
      </PropertySectionInnerContainer>

      <BannerSections
        image={images.buyBanner}
        description={constants.buyProperty.description}
        title={constants.buyProperty.title}
        button={constants.buyProperty.button}
        link={constants.buyProperty.link}
      ></BannerSections>

      <PropertySectionInnerContainer>
        {salePropertyArray.map((array) => {
          if (array.externalID === "") {
            urlString = "";
          }
          return (
            <PropertySection
              title={array.title}
              baths={array.baths}
              rooms={array.rooms}
              price={Number(array.price)}
              area={Number(array.area)}
              image={array.image}
              link={`${urlString}${array.externalID}`}
            ></PropertySection>
          );
        })}
      </PropertySectionInnerContainer>
    </>
  );
}
